As the above set of database objects are typically to be compared to the contents of a single MetaData object, particularly when the EnvironmentContext.configure.include_schemas flag is enabled there is an important need to filter out unwanted “schemas”, which for some database backends might be the list of all the databases present. This filtering is best performed using the EnvironmentContext.configure.include_name hook, which provides for a callable that may return a boolean true/false indicating if a particular schema name should be included: def include_name(name, type_, parent_names): if type_ == "schema": # note this will not include the default schema return name in ["schema_one", "schema_two"] else: return True context.configure( # ... include_schemas = True, include_name = include_name
) Above, when the list of schema names is first retrieved, the names will be filtered through the above include_name function so that only schemas named "schema_one" and "schema_two" will be considered by the autogenerate process. In order to include the default schema , that is, the schema that is referred towards by the database connection without any explicit schema being specified, the name passed to the hook is None. To alter our above example to also include the default schema, we compare to None as well: def include_name(name, type_, parent_names): if type_ == "schema": # this **will* include the default schema return name in [None, "schema_one", "schema_two"] else: return True context.configure( # ... include_schemas = True, include_name = include_name
)

